library(leaflet)
library(htmlwidgets)
library(glue)

img_width &lt;- 3800
img_height &lt;- 2400

leaflet(options = leafletOptions(
  crs = leafletCRS(crsClass = "L.CRS.Simple"),
  minZoom = -1,
  maxZoom = 2
)) |&gt;
  setView(lng = img_width / 2, lat = img_height / 2, zoom = 0) |&gt;
  fitBounds(0, 0, img_width, img_height) |&gt;
 onRender("
    function(el, x) {
      var imageUrl = 'media/Samgallery.jpg';
      var imageBounds = [[0, 0], [2400, 3800]];
      L.imageOverlay(imageUrl, imageBounds).addTo(this);
    }
  ") |&gt;
  addRectangles(
    lng1 = 2731, lat1 = 937,
    lng2 = 3134, lat2 = 1792,
    fillOpacity = 0,
    stroke = FALSE,
    popup = 'media/ENVS_40_Zine_1.png')
